import { Card, Image } from "react-bootstrap";
import serg from '../resources/surgeon.jpg'

export default function MyCard({ type, desc, image_id }) {
    return (
        <Card style={{ width: '18rem'}}>
            <Card.Img variant="contain" src={image_id} />
            <Card.Body style={{ background: 'black', color: 'white'}}>
                <Card.Title>{type}</Card.Title>
                <Card.Text className="test-rect" style={{ background: rgba(0, 0, 0, 0.5)}}>{desc}</Card.Text>
            </Card.Body>
        </Card>
    )
}
